import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import './PrizesSection.css';

const PrizesSection = () => {
  const [ref, inView] = useInView({
    threshold: 0.2,
    triggerOnce: true
  });

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        delayChildren: 0.3,
        staggerChildren: 0.2
      }
    }
  };

  const cardVariants = {
    hidden: { y: 50, opacity: 0, scale: 0.9 },
    visible: {
      y: 0,
      opacity: 1,
      scale: 1,
      transition: {
        duration: 0.8,
        ease: "easeOut"
      }
    }
  };

  const prizes = [
    {
      title: "Best Overall Impact",
      prize: "$5,000",
      icon: "üèÜ",
      description: "The solution with the most comprehensive social impact and innovation",
      color: "var(--primary-indigo)",
      gradient: "linear-gradient(135deg, var(--primary-indigo), var(--accent-coral))"
    },
    {
      title: "Best Idea for Education",
      prize: "$3,000",
      icon: "üìö",
      description: "Most innovative solution addressing educational challenges",
      color: "var(--highlight-emerald)",
      gradient: "linear-gradient(135deg, var(--highlight-emerald), var(--primary-indigo))"
    },
    {
      title: "Best Health Innovation",
      prize: "$3,000",
      icon: "üè•",
      description: "Outstanding healthcare or wellness technology solution",
      color: "var(--accent-coral)",
      gradient: "linear-gradient(135deg, var(--accent-coral), var(--highlight-emerald))"
    },
    {
      title: "Best Environmental Solution",
      prize: "$3,000",
      icon: "üå±",
      description: "Most impactful environmental sustainability project",
      color: "var(--highlight-emerald)",
      gradient: "linear-gradient(135deg, var(--highlight-emerald), var(--accent-coral))"
    },
    {
      title: "Best Inclusion Initiative",
      prize: "$2,500",
      icon: "ü§ù",
      description: "Solution promoting diversity, equity, and inclusion",
      color: "var(--primary-indigo)",
      gradient: "linear-gradient(135deg, var(--primary-indigo), var(--highlight-emerald))"
    },
    {
      title: "People's Choice Award",
      prize: "$2,000",
      icon: "‚ù§Ô∏è",
      description: "Voted by participants as the most inspiring project",
      color: "var(--accent-coral)",
      gradient: "linear-gradient(135deg, var(--accent-coral), var(--primary-indigo))"
    }
  ];

  return (
    <section className="prizes-section section" id="prizes">
      <div className="container">
        <motion.div 
          ref={ref}
          className="prizes-content"
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
        >
          <motion.h2 className="section-title" variants={cardVariants}>
            Prizes & Recognition
          </motion.h2>

          <motion.p className="prizes-subtitle" variants={cardVariants}>
            Celebrating innovation, impact, and meaningful change
          </motion.p>

          <div className="prizes-grid">
            {prizes.map((prize, index) => (
              <motion.div 
                key={index}
                className={`prize-card ${index === 0 ? 'featured' : ''}`}
                variants={cardVariants}
                whileHover={{ 
                  y: -10, 
                  scale: 1.02,
                  transition: { duration: 0.3 }
                }}
              >
                <div className="prize-icon-container">
                  <div 
                    className="prize-icon-bg"
                    style={{ background: prize.gradient }}
                  ></div>
                  <div className="prize-icon">{prize.icon}</div>
                </div>

                <div className="prize-content">
                  <h3 className="prize-title">{prize.title}</h3>
                  <div className="prize-amount">{prize.prize}</div>
                  <p className="prize-description">{prize.description}</p>
                </div>

                <div className="prize-glow" style={{ background: prize.gradient }}></div>
              </motion.div>
            ))}
          </div>

          <motion.div className="additional-perks" variants={cardVariants}>
            <h3>Additional Perks for All Participants</h3>
            <div className="perks-grid">
              <div className="perk-item">
                <span className="perk-icon">üéì</span>
                <span className="perk-text">Mentorship Opportunities</span>
              </div>
              <div className="perk-item">
                <span className="perk-icon">üåê</span>
                <span className="perk-text">Networking Events</span>
              </div>
              <div className="perk-item">
                <span className="perk-icon">üìú</span>
                <span className="perk-text">Certificates of Participation</span>
              </div>
              <div className="perk-item">
                <span className="perk-icon">üöÄ</span>
                <span className="perk-text">Startup Incubator Access</span>
              </div>
            </div>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default PrizesSection;
